const dataList = [
    { id:1, title:"Dashboard"},
    { id:2, title:"Users"},
    { id:3, title:"Products"},
    { id:4, title:"Locations"}  
];

const info = [
    { id:1, title:"The Shawshank Redemption", year:1994, votes:678790, rating:9.2, rank:1},
    { id:2, title:"The Godfather", year:1972, votes:511495, rating:9.2, rank:2},
    { id:3, title:"The Godfather: Part II", year:1974, votes:319352, rating:9, rank:3},
    { id:4, title:"The Good, the Bad and the Ugly", year:1966, votes:213020, rating:8.9, rank:4},
    { id:5, title:"My Fair Lady", year:1964, votes:533848, rating:8.9, rank:5},
    { id:6, title:"12 Angry Men", year:1957, votes:164558, rating:8.9,rank:6}       
];
const header = { view:"toolbar", css:"webix_dark", elements:[
    { view:"label", label:"My App", css:"top_label"},
    {},
    { view:"button", id:"butHed", label:"Profile", css:"webix_transparent", type:"icon", icon:"wxi-user", width: 150,
        click: () => {winPopup.show()} }
    ]};

const leftList = {
    view:"list", 
    id:"mylist",
    template:"#title#", 
    select:true,  
    data: dataList,
    css: "list_bgc",
    on:{
        onItemClick:function(id){
            webix.message("Item was clicked "+id);
        }
    }
    //type: "clean" 
    }
const winPopup = webix.ui({
    view:"popup",
    top:42, 
    left:1140,
    body:{
        view:"list", 
        template:"#title#", 
        select:true,  
        autoheight:true, 
        autowidth:true, 
        data: [ {id:1, title:"Settings"},
                {id:2, title:"Log Out"} ]
    }
});

const footer = {
    template:"The software is provided by <a href='https://webix.com' target='_blank'>https://webix.com</a>. All rights reserved (c)",
    height:40 };

webix.ui({
type:"line",
rows: [
    header,
    { cols:[ 

        leftList,

        {view:"resizer"}, 

        { view:"datatable",
        autowidth:true, 
        id: "tableInfo",
        autoConfig: true,
        scrollX: false, 
            columns:[   
                { id:"title", header:"Title"},
                { id:"year", header:"Year"},
                { id:"votes", header:"Votes"},
                { id:"rating", header:"Rating"},
                { id:"rank", header:"Rank"},    
            ],
        data: info
        },
        {   view:"form",
            id:"myform",
            rules:{
                title:webix.rules.isNotEmpty,
                year:function(value){
                    return (value>=1970 && value<=thisYear);},
                votes:function(value){
                    return (value>=10000);},

                rating:function(value){
                    return (value !== '0' && value !== "");}
                },    
            elements:[
                { rows:[
                    { type: "section", template:"Edit films", },
                    { view:"text", label:"Title", name:"title", invalidMessage:"Enter movie title"},
                    { view:"text", label:"Year", name:"year", invalidMessage:"Enter year between 1970 and this yer"},
                    { view:"text", label:"Rating", name:"rating", invalidMessage:"rating should not be 0"},
                    { view:"text", label:"Votes", name:"votes", invalidMessage:"votes must be more than 10,000"},

                    { cols: [
                        { view:"button", value:"Add new", css:"bluebutton", click:function(){


                            if($$("myform").validate()){
                                webix.alert({
                                    text: "Verification successful",
                                }).then(function(){
                                    let item = $$("myform").getValues();
                                    $$("tableInfo").add(item);
                                });

                            }
                        }},
                        { view:"button", value:"Clear", click: () =>{
                             webix.confirm({
                                title:"",
                                text:"Clear this form?"
                            }).then(		
                                function(){	 			// if true
                                    $$("myform").elements.title.setValue("");
                                    $$("myform").elements.year.setValue("");
                                    $$("myform").elements.rating.setValue("");
                                    $$("myform").elements.votes.setValue(""); 
                                    $$("myform").clearValidation();},    
                                function(){} );   
                        }}
                    ]}
            ], },
            {},
        ]}, 
    ]}  ,
    footer


]

});

const thisYear = new Date().getFullYear();
